import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';
import logo from './entur_logo.jpg';
import Background from './background.jpg';

class NavBar extends React.Component {

    render() {
        return (
            <div className="navBar">
                <div className="logo">
                    <img src={logo} width={180} height={80} />
                </div>
            </div>
        )
    }

}

var Application = React.createClass({

    getInitialState: function () {
        return {
            selectedOption: 'option1'
        };
    },

    handleOptionChange: function (changeEvent) {
        this.setState({
            selectedOption: changeEvent.target.value
        });
    },

    handleFormSubmit: function (formSubmitEvent) {
        formSubmitEvent.preventDefault();

        console.log('You have selected:', this.state.selectedOption);
    },

    render: function () {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-sm-12">

                        <form onSubmit={this.handleFormSubmit}>
                            <div className="radio">
                                <label>
                                    <input type="radio" value="option1" checked={this.state.selectedOption === 'option1'} onChange={this.handleOptionChange} />
                                    Option 1
                                </label>
                            </div>
                            <div className="radio">
                                <label>
                                    <input type="radio" value="option2" checked={this.state.selectedOption === 'option2'} onChange={this.handleOptionChange}/>
                                    Option 2
                                </label>
                            </div>
                            <div className="radio">
                                <label>
                                    <input type="radio" value="option3" checked={this.state.selectedOption === 'option3'} onChange={this.handleOptionChange}/>
                                    Option 3
                                </label>
                            </div>
                            <button className="btn btn-default" type="submit">Save</button>
                        </form>

                    </div>
                </div>
            </div>
        );
    }
});

class Register_box extends React.Component {

    render() {
        return (
            <form>
                <h3 className="text-center text-white">Registrer ny melding</h3>
                <br></br>
                <div className="form-row d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="fromDate p-2 flex-grow-1">
                        <p className="text-center text-white">Fra</p>
                        <input type="datetime-local" className="form-control" placeholder="Fra dato"/>
                    </div>
                    <div className="toDate p-2 flex-grow-1">
                        <p className="text-center text-white">Til</p>
                        <input type="datetime-local" className="form-control" placeholder="Til dato"/>
                    </div>
                </div>
                <div className="message">
                    <p className="text-center text-white">Melding</p>
                    <input type="String" className="form-control" placeholder="Melding"/>
                </div>
                <br></br>
                <br></br>
                <div className="btn-group btn-group-toggle d-flex flex-row bd-highlight mb-3 justify-content-center" data-toggle="buttons">
                    <label className="btn btn-outline-light p-3">
                        <input type="checkbox" name="options" id="option1" autoComplete="off"/> Linje
                    </label>
                    <label className="btn btn-outline-light p-3">
                        <input type="radio" name="options" id="option2" autoComplete="off"/> Stopp
                    </label>
                    <label className="btn btn-outline-light p-3">
                        <input type="radio" name="options" id="option3" autoComplete="off"/> Avgang
                    </label>
                </div>
                <div className="search">
                    <input type="String" className="form-control" placeholder="SÃ¸k"/>
                </div>
                <br></br>
                <br></br>
                <div className="sumbit">
                    <button type="submit" className="btn btn-primary btn-lg btn-block">Submit</button>
                </div>
            </form>

        );
    }
}

class New_SX extends React.Component {
    render() {
        return (
            <div className="new_sx">
                <img id="background" src={ Background } />
                <div className="navBar">
                    <NavBar />
                </div>
                <div className="register_box" >
                    <Register_box />
                    <Application/>
                </div>
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <New_SX />,
    document.getElementById('root')
);
